import React, { useState } from 'react';

export default function App() {
  const [noCount, setNoCount] = useState(0);
  const [noPosition, setNoPosition] = useState({ x: 0, y: 0 });
  const [answered, setAnswered] = useState(false);

  const noTexts = [
    "No",
    "Are you sure?",
    "Really?",
    "Think again!",
    "Don't be shy...",
    "Pretty please?",
    "Just click Yes!",
    "You know you want to...",
    "Last chance!",
    "Please? ü•∫",
    "I won't give up!",
    "Come on...",
    "Pwease? ü•∫"
  ];

  const handleNoHover = () => {
    setNoCount(prev => prev + 1);

    const maxX = 180;
    const maxY = 120;
    const newX = (Math.random() - 0.5) * maxX;
    const newY = (Math.random() - 0.5) * maxY;

    setNoPosition({ x: newX, y: newY });
  };

  const handleYes = () => {
    setAnswered(true);
  };

  if (answered) {
    return (
      <div style={{
        minHeight: '100vh',
        background: '#ffc9d9',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        fontFamily: '"Nunito", "Comic Sans MS", cursive',
        position: 'relative',
        overflow: 'hidden'
      }}>
        {/* Colorful confetti */}
        {[...Array(50)].map((_, i) => (
          <div
            key={`confetti-${i}`}
            style={{
              position: 'absolute',
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              width: '10px',
              height: '10px',
              backgroundColor: ['#ff6b9d', '#ffd93d', '#6bcf7f', '#4d9fff', '#ff8364', '#c780e8'][Math.floor(Math.random() * 6)],
              borderRadius: Math.random() > 0.5 ? '50%' : '2px',
              animation: `confettiFall ${Math.random() * 3 + 2}s linear infinite`,
              animationDelay: `${Math.random() * 2}s`,
              transform: `rotate(${Math.random() * 360}deg)`
            }}
          />
        ))}

        {/* Sparkles */}
        {[...Array(15)].map((_, i) => (
          <div
            key={`sparkle-${i}`}
            style={{
              position: 'absolute',
              left: `${Math.random() * 100}%`,
              top: `${Math.random() * 100}%`,
              fontSize: '25px',
              animation: `sparkleFloat ${Math.random() * 2 + 3}s ease-in-out infinite`,
              animationDelay: `${Math.random() * 2}s`,
            }}
          >
            ‚ú®
          </div>
        ))}

        <style>{`
          @import url('https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;700;800&display=swap');

          @keyframes confettiFall {
            0% { transform: translateY(-100vh) rotate(0deg); opacity: 1; }
            100% { transform: translateY(100vh) rotate(720deg); opacity: 0.3; }
          }

          @keyframes sparkleFloat {
            0%, 100% { transform: translateY(0px) scale(1); opacity: 0.6; }
            50% { transform: translateY(-20px) scale(1.3); opacity: 1; }
          }

          @keyframes bounce {
            0%, 100% { transform: translateY(0px); }
            50% { transform: translateY(-10px); }
          }
        `}</style>

        <div style={{
          textAlign: 'center',
          position: 'relative',
          zIndex: 10,
        }}>
          {/* Cute cats with hearts */}
          <div style={{
            fontSize: '200px',
            marginBottom: '30px',
            animation: 'bounce 1s ease-in-out infinite'
          }}>
            üò∫‚ù§Ô∏èüò∏
          </div>

          <h1 style={{
            fontSize: '70px',
            color: '#ff6b9d',
            fontWeight: 800,
            marginBottom: '20px',
            textShadow: '0 4px 0 rgba(255, 255, 255, 0.5)',
            letterSpacing: '2px'
          }}>
            ‚ô° Yipee! ‚ô°
          </h1>

          <p style={{
            fontSize: '32px',
            color: '#ff3d7f',
            fontWeight: 700,
            marginTop: '20px'
          }}>
            I knew you'd say yes! üíï
          </p>
        </div>
      </div>
    );
  }

  return (
    <div style={{
      minHeight: '100vh',
      background: '#ffc9d9',
      display: 'flex',
      alignItems: 'center',
      justifyContent: 'center',
      fontFamily: '"Nunito", "Comic Sans MS", cursive',
      position: 'relative',
      overflow: 'hidden',
      padding: '20px'
    }}>
      <style>{`
        @import url('https://fonts.googleapis.com/css2?family=Nunito:wght@400;600;700;800&display=swap');

        @keyframes float {
          0%, 100% { transform: translateY(0px); }
          50% { transform: translateY(-15px); }
        }

        @keyframes heartbeat {
          0%, 100% { transform: scale(1); }
          50% { transform: scale(1.1); }
        }

        @keyframes wiggle {
          0%, 100% { transform: rotate(0deg); }
          25% { transform: rotate(-3deg); }
          75% { transform: rotate(3deg); }
        }

        .yes-button {
          transition: all 0.3s cubic-bezier(0.68, -0.55, 0.265, 1.55);
        }

        .yes-button:hover {
          transform: scale(1.1);
        }

        .no-button {
          transition: all 0.4s cubic-bezier(0.34, 1.56, 0.64, 1);
        }

        .no-button:hover {
          animation: wiggle 0.5s ease-in-out;
        }
      `}</style>

      <div style={{
        textAlign: 'center',
        maxWidth: '700px',
        position: 'relative'
      }}>
        {/* Hearts decorations */}
        <div style={{
          position: 'absolute',
          top: '-60px',
          left: '50%',
          transform: 'translateX(-50%)',
          fontSize: '35px',
          animation: 'heartbeat 1.5s ease-in-out infinite'
        }}>
          ‚ô°
        </div>

        {/* Title */}
        <h1 style={{
          fontSize: '50px',
          color: '#ff6b9d',
          fontWeight: 800,
          marginBottom: '40px',
          textShadow: '0 3px 0 rgba(255, 255, 255, 0.3)',
          letterSpacing: '1px'
        }}>
          ‚ô° Will you be my Valentine? ‚ô°
        </h1>

        {/* Cute characters */}
        <div style={{
          fontSize: '180px',
          marginBottom: '50px',
          animation: 'float 2s ease-in-out infinite'
        }}>
          üêªüåπüëë
        </div>

        {/* Buttons container */}
        <div style={{
          display: 'flex',
          gap: '30px',
          justifyContent: 'center',
          alignItems: 'center',
          position: 'relative',
          minHeight: '90px',
          marginBottom: '30px'
        }}>
          <button
            onClick={handleYes}
            className="yes-button"
            style={{
              padding: '18px 50px',
              fontSize: '28px',
              fontWeight: 700,
              background: 'white',
              color: '#ff3d7f',
              border: '4px solid #ff3d7f',
              borderRadius: '50px',
              cursor: 'pointer',
              fontFamily: 'inherit',
              boxShadow: '0 6px 0 #ff3d7f',
              position: 'relative',
              top: 0,
            }}
            onMouseDown={(e) => e.target.style.top = '4px'}
            onMouseUp={(e) => e.target.style.top = '0px'}
            onMouseLeave={(e) => e.target.style.top = '0px'}
          >
            Yes
          </button>

          <button
            onMouseEnter={handleNoHover}
            className="no-button"
            style={{
              padding: '18px 50px',
              fontSize: '28px',
              fontWeight: 700,
              background: 'white',
              color: '#999',
              border: '4px solid #ddd',
              borderRadius: '50px',
              cursor: 'pointer',
              fontFamily: 'inherit',
              boxShadow: '0 6px 0 #ddd',
              position: 'absolute',
              left: '50%',
              transform: `translate(calc(-50% + ${noPosition.x}px), ${noPosition.y}px)`,
              top: 0,
            }}
            onMouseDown={(e) => e.target.style.top = '4px'}
            onMouseUp={(e) => e.target.style.top = '0px'}
            onMouseLeave={(e) => e.target.style.top = '0px'}
          >
            {noTexts[Math.min(noCount, noTexts.length - 1)]}
          </button>
        </div>

        {/* Message after trying to click No */}
        {noCount > 0 && (
          <p style={{
            fontSize: '24px',
            color: '#ff3d7f',
            fontWeight: 700,
            marginTop: '30px',
            animation: 'heartbeat 1s ease-in-out infinite'
          }}>
            {noCount < 3 && "Come on... ü•∫"}
            {noCount >= 3 && noCount < 6 && "Please baby rose... üåπ"}
            {noCount >= 6 && "I know you want to say yes! üíï"}
          </p>
        )}
      </div>
    </div>
  );
}
